$(document).ready(function(){$("body").append('<div class="modal fade " id="modelHolder" tabindex="-1" role="dialog" aria-hidden="true"><div class="modal-dialog modal-dialog-centered"></div></div>')});
$(document).on("click",".d3l3t3btn",function(o){o.preventDefault();let t=$(this).attr("data-attr");$.ajax({url:t,beforeSend:function(){$.LoadingOverlay("show",{image:"",fontawesome:"fa fa-cog fa-spin"})},success:function(o){$("#modelHolder").modal("show"),$("#modelHolder .modal-dialog").html(o).show()},complete:function(){$.LoadingOverlay("hide")},error:function(o,e,n){Swal.fire({title:"Error",text:"Page "+t+" cannot open. Error:"+n,type:"error",confirmButtonClass:"btn btn-danger",buttonsStyling:!1}),console.log(n),$.LoadingOverlay("hide")},timeout:8e3})});